import React from 'react';
import Navbar from '../Home/Navbar';
import Footer from '../Home/Footer'

const About = ( ) => {
    return(
        <>
            <Navbar />
            
            <div className='about_main'>    
                <h1>This is About Page</h1>
            </div>

            <Footer />
        </>
    )
}

export default About;
